import React from 'react'
import { Footer, Navbar, Wishlist } from '../../components/allComponents'
import "./wishlistPage.css"
function WishlistPage() {
  return (
    <>
    <Navbar />
    <Wishlist />
    <Footer />
    </>
  )
}

export { WishlistPage }
